import Api from '../Apit.json'
import ChargerList from './ChargerList';
const Charger = (props) => {
      let charge = [];
      let array = [];
      let result = [];
      for(let i in Api.item){
        if(((props.MyLat + 0.1) > Api.item[i].lat && Api.item[i].lat > (props.MyLat - 0.1)) &&
          ((props.MyLng + 0.1) > Api.item[i].lng && Api.item[i].lng > (props.MyLng - 0.1))){
            array.push(Api.item[i].statNm)
          }};

      // console.log(arr)
      result = array.filter((v, j) => {
        if(array.indexOf(v) === j){
          result.push(
          charge[j] = <ChargerList
            key={v}
            lat={Api.item[v].lat}
            lng={Api.item[j].lng}
            title={Api.item[j].statNm}
            addr={Api.item[j].addr}
            useTime={Api.item[j].useTime}
            stat={Api.item[j].stat}
            chgerType={Api.item[j].chgerType}
            setLat={props.setLat} 
            setLng={props.setLng}
          />
          )
        }
        
      });
            
      console.log(result);
  return charge
}

export default Charger
